import React from 'react'

const Cars = ({cars}) =>{
    const carlist = cars.map(car =>{
        return(
            <div className= "cars" key={car.id}>
                <div className="card">
                    <div className="card-image">
                        <img src={car.src} alt=""/>    
                    </div>
                    <div className="card-content">
                        <p> {car.name}</p>

                    </div>

                </div>
            </div>

        )
    })
    return(
        <div className="car-list">
            <div className= "row">
                {carlist}
            </div>

        </div>
    )
}

export default Cars;
